import Bot.Bot;import org.telegram.telegrambots.ApiContextInitializer;import org.telegram.telegrambots.TelegramBotsApi;import org.telegram.telegrambots.exceptions.TelegramApiException;import org.telegram.telegrambots.exceptions.TelegramApiRequestException;public class Main {    public static void main(String[] args) throws TelegramApiException {        ApiContextInitializer.init();        TelegramBotsApi telegramBotsApi = new TelegramBotsApi();        try {            Bot bot = new Bot();            telegramBotsApi.registerBot(bot);        } catch (TelegramApiRequestException e) {            e.printStackTrace();        }    }}